import styled from "styled-components";

export const NavBarStyle = styled.div`
  width: 100%;
  height: 10vh;
  display: flex;
  flex-direction: row;
  background-color: blueviolet;
  color: white;
`;

export const MenuStyle = styled.div`
  width: 50%;
  height: 10vh;
  display: flex;
  flex-direction: column;
  background-color: pink;
  color: white;
`;
